INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(1, 'Kozak System', 'kozak@gmail.com', , 'Founded in 2012 in Kyiv from musicians who left the band Haidamaky. As of 2018, they have five recorded albums: \"Saber\" (2012), \"Homing Songs\" (with Taras Chubai, 2014), \"Live and Love\" (2015), \"Not Mine\" (2018), and \"Thieves in Love\" (2020). The band consists of five musicians: Ivan Lenyo on vocals/accordion, Oleksandr Demianenko (Dem) on guitar, Volodymyr Sherstiuk on bass, Serhiy Soloviy on trumpet, and Serhiy Borysenko on drums. Since its inception, Kozak System has toured more than 18 countries.', '$2y$10$lPn2Txbm/WVBnKVfVKExUucN.X1F8wFs89irGaPYqo5wT4FSPbrTy');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(2, 'Okean Elzy', 'OkeanE@gmail.com', , 'Okean Elzy (Ukrainian:  , translation: Elza\'s Ocean) is a Ukrainian rock band. It was formed in 1994 in Lviv, Ukraine. It is the most famous and successful Ukrainian music band. The band\'s vocalist and frontman is Svyatoslav Vakarchuk. In April 2007 Okean Elzy received FUZZ Magazine music awards for \"Best rock act\".', '$2y$10$sPAbW7Nots2uVbS9I37Rq.tT6jckhPYtXdHYe1azxT4On7rLm4pJ.');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(5, 'Nervy', 'nervy@gmail.com', , 'Nervy is a Ukrainian rock band from Ukraine, formed in 2010 in Kyiv by vocalist and guitarist Yevhen Milkovsky. On May 22, 2012, the band debuted its album \"Everything That\'s Around\" in Moscow. The band toured Russia, Ukraine, Belarus and Kazakhstan.', '$2y$10$5JPhJXi/s4PCXL2kjiKf9epW17157x9TRE9HD3qBs6W.TgRlWESG6');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(6, 'Valentyn Strykalo', 'strykalo@gmail.com', , 'Ukrainian rock band founded in 2010 by lead singer Yuriy Kaplan, who gained fame after recording a series of video messages to showbiz stars on behalf of a naive provincial boy, Valentyn Strykalo from the village of Buryltseve.\r\nKaplan founded the band under the influence of the music of such rock bands as Splin and Radiohead. In 2012, the band released its debut album, \"Accept and Relax!\", which was mostly written in the genre of comedy rock, even though it contained songs with a serious character. The following year, the album \"Part of Something Bigger\" was released, which emphasized more on lyrics, but also had some veiled humor in some songs. In 2016, they released the album \"Entertainment\", in which the band finally moved away from humor and went to the topic of depression. The record also shows that the band was inspired by the British rock band Pink Floyd.', '$2y$10$9l1qPHut2AA7kswNpHB9b.CGHQE1OiGGiLm0TKcW1xwvExw2gTPY2');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(7, 'Alekseev', 'alekseev@gmail.com', , 'Mykyta Volodymyrovych Alieksieiev (born 18 May 1993), better known by his mononym Alekseev, is a Ukrainian singer and songwriter. He first began his career in 2014 after placing as a semifinalist on season four of The Voice of Ukraine. He subsequently released the single \"Pyanoye solntse\", which went on to become a number-one hit throughout the CIS and kickstarted his music career. He represented Belarus in the Eurovision Song Contest 2018 in Portugal with his song \"Forever\".', '$2y$10$Sb4DkATvm3X7KcLaNla6quIHAqYm.Q9XnU2hBMzOEPfNdGH.TcJhq');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(8, 'Dorofeeva', 'dorofeeva@gmail.com', , 'Nadiia Volodymyrivna Dorofieieva (Ukrainian:   ; born 21 April 1990), professionally known as DOROFEEVA, is a Ukrainian pop singer, fashion designer, blogger, actress and a former member of the pop duo Vremya i Steklo, which was created and produced by Potap.', '$2y$10$jK1XuqVJFFuQQ32HXvz3b.MuQzyknipeKVne8.Iho5M1GO2lQfCCS');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(9, 'AC DC', 'acdc@gmail.com', , 'AC/DC are an Australian rock band formed in 1973. They were founded by brothers Malcolm Young on rhythm guitar and Angus Young on lead guitar. Their current lineup comprises Angus, bassist Cliff Williams, drummer Phil Rudd, lead vocalist Brian Johnson, and rhythm guitarist Stevie Young, nephew of Angus and Malcolm. Their music has been variously described as hard rock, blues rock and heavy metal, but the band calls it simply \"rock and roll\". They are cited as a formative influence on the new wave of British heavy metal bands, such as Def Leppard and Saxon. AC/DC were inducted into the Rock and Roll Hall of Fame in 2003.', '$2y$10$0XP6b6JUMeYSo./waK6DUO7YPEhxuZ11vEoA99NLvo93ctQBnp5xO');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(10, 'Beatles', 'beatles@gmail.com', , 'better known in the Hispanic world as the Beatles, were a British rock band formed in Liverpool during the 1960s.\r\nFrom 1962 until their separation in 1970 it consisted of John Lennon (1940-1980), Paul McCartney (1942-), George Harrison (1943-2001) and Ringo Starr (1940-).', '$2y$10$CPp6H3zqlriuYYymZz0D8OeA4jBo/zPQ9OvARC2rXYBzYkd8biwkG');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(12, 'smetana band', 'smetana@gmail.com', , 'Smetana Band is a Ukrainian rock band founded in 2013 in Dnipro by Yegor Kuvaldin[4] and Sergey Savochkin. The band is considered to be one of the main representatives of pop-punk on the Ukrainian scene.', '$2y$10$O67JGOl.SLBDLU8TQtKqVeGkKYnJA9dNCCd.qYpexUYmN0AYsKkt.');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(15, 'Imagine Dragons', 'dragons@gmail.com', , 'Imagine Dragons are an American pop rock band formed in 2008, based in Las Vegas, Nevada, and currently consists of lead singer Dan Reynolds, guitarist Wayne Sermon, bassist Ben McKee and drummer Daniel Platzman. The band first gained exposure with the release of their single \"It\'s Time\", followed by their debut album Night Visions (2012), which resulted in the chart-topping singles \"Radioactive\" and \"Demons\". Rolling Stone named \"Radioactive\", which held the record for most weeks charted on the Billboard Hot 100, the \"biggest rock hit of the year\".MTV called them \"the year\'s biggest breakout band\", and Billboard named them their \"Breakthrough Band of 2013\" and \"Biggest Band of 2017\", and placed them at the top of their \"Year in Rock\" rankings for 2013, 2017, and 2018. Imagine Dragons topped the Billboard Year-End \"Top Artists  Duo/Group\" category in 2018.', '$2y$10$YIiZ/llxU2sj1SREWcOcoeFEh.9VRLgayTEjMX9nzTbYGcDep1bLG');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(17, 'Rihanna', 'rihana@gmail.com', , 'Robyn Rihanna Fenty (born 20 February 1988), known simply as Rihanna, is a Barbadian singer, actress, designer and businesswoman. Born in Saint Michael and raised in Bridgetown, Barbados, Rihanna auditioned for American record producer Evan Rogers in 2003, who invited her to the United States to record demo tapes. After signing with Def Jam in 2005, she soon gained recognition with the release of her first two studio albums, Music of the Sun (2005) and A Girl Like Me (2006), both influenced by Caribbean music and peaked within the top ten of the US Billboard 200 chart.', '$2y$10$rJz74CTLAxoBdZ..rXLNj.oL.TyNOxswwfdiAD5NnY4y9okIngDmi');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(21, 'Vladymir Dantes', 'dantes@gmail.com', , 'Real name: Volodymyr Ihorovych Gudkov (born June 28, 1988, Kharkiv) is a Ukrainian singer, TV presenter, radio host, and former member of the band DiO.films, which disbanded in 2015. He started his solo career under the pseudonym Dantes.', '$2y$10$6INnlwHHP0PvNOt2aV79OuykRdZSaVUSHisLSc3avGqUjz/Qc/bjW');
INSERT INTO `user` (`id`, `name`, `email`, `image`, `description`, `password`) VALUES
(22, 'Antytila', 'antytila@gmail.com', , 'Antytila (Ukrainian: ) is a Ukrainian musical group. It includes Taras Topolia (vocals), Serhii Vusyk (keyboard, artistic director), Dmytro Zholud (guitar), and Dmytro Vodovozov (drums), Mykhailo Chyrko (bass)', '$2y$10$s.QV8OuasDDgF/dKrhjBNupbjYaiHI8wl4sEyHZPIZrnKYuIPgSiK');

